import './ServiceItem.css';

function ServiceItem({serviceTitle, serviceDesc, button}) {
    return (
        <div className='service-item'>
            <div className='service-title'>
                {serviceTitle}
            </div>
            <div className='service-desc'>
                {serviceDesc}
            </div>
            <button className=''>
                {button}
            </button>

        </div>
            );
};

export default ServiceItem;
